function mapActionType(type) {
    switch(type){
        case 'response':
            return undefined;
        case 'create':
            return 'add';
        case 'update':
            return 'edit';
        case 'delete':
            return 'delete';
    }
}
class ChatService {
    static async processMessage(message, events) {
        try {
            const response = await fetch('http://localhost:8080/api/chat', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({
                    message,
                    timezone: Intl.DateTimeFormat().resolvedOptions().timeZone
                })
            });
            if (!response.ok) {
                throw new Error('Failed to process message');
            }
            const data = await response.json();
            // Just return the response and let the frontend handle the actions
            return {
                text: data.message,
                action: data.action ? mapActionType(data.action.type) : undefined,
                success: true
            };
        } catch (error) {
            console.error('Error processing message:', error);
            return {
                text: "Something went wrong while processing your message. Could you try again?",
                success: false
            };
        }
    }
}
